INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 2, 40011, 1, 1, "リリ", 0, 321, 125801, 24001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 2, 40011, 1, 1, "クリア", 0, 322, 126001, 24001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("んーと。\nこれ、あげる。\nはい", 3, 2, 40011, 1, 1, "プレシア", 0, 323, 126101, 24001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 4, 2, 40011, 2, 1, "リリ", 0, 324, 125801, 24001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 5, 2, 40011, 2, 1, "クリア", 0, 325, 126001, 24001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES ("お兄。\nきてくれて、うれしい", 6, 2, 40011, 2, 1, "プレシア", 0, 326, 126101, 24001);
